import styled from "styled-components";

export const Inner_warpper = styled.div`
  position: relative;

`
export const Inner_grid = styled.div`
width:1190px;
margin:0 auto;
height:480px;
`
export const Inner_left = styled.div`
    position: relative;
    float: left;
    width:190px;
    height: 480px;
    margin-right: 10px;
    ul{
      overflow:hidden;
      padding:10px 0;
      height:450px;
      background:#fefefe;
      color:#636363;
      margin-top:10px;
    }
    li{
      padding-left: 18px;
      height: 25px;
      line-height: 25px;
      font-size:15px;
    }
    .cate_part{
      position:absolute;
      top:10px;
      left:190px;
    }
`
